import React from 'react';

const VerDiario = () => {
  // pruebba
  const entradasFicticias = [
    { fecha: '2025-05-01', horas: 4, descripcion: 'Configuración de entorno de desarrollo' },
    { fecha: '2025-05-02', horas: 3, descripcion: 'Implementación de login con JWT' }
  ];

  return (
    <div className="flex flex-col min-h-screen">
    <Navbar />
    <h2 className="text-3xl font-bold text-center text-red-800 mb-4 p-4">Iniciar sesión</h2>

    <main className="flex items-center justify-center flex-1">
        <div className="min-h-screen flex flex-col items-center justify-center bg-gray-50">
            <h1 className="text-3xl font-bold text-red-800 mb-4">Bienvenido Alumno:</h1>
            <p className="text-lg text-gray-700">Usuario conectado: {userData.nombre} {userData.apellidos}, con DNI: {userData.dni}</p>
        </div>
    <div className="max-w-3xl mx-auto space-y-4">
      {entradasFicticias.map((entrada, i) => (
        <div key={i} className="border p-4 rounded shadow">
          <div><strong>Fecha:</strong> {entrada.fecha}</div>
          <div><strong>Horas:</strong> {entrada.horas}</div>
          <div><strong>Descripción:</strong> {entrada.descripcion}</div>
        </div>
      ))}
    </div>
    </main>
    <Footer />
    </div>
  );
};

export default VerDiario;
